import React, { useEffect, useState } from "react";
import CustomizedText from "../../atoms/CustomizedText/CustomizedText";
import CustomizedTextInput from "../../atoms/CustomizedTextInput/CustomizedTextInput";
import CustomizedBtn from "../../atoms/CustomizedBtn/CustomizedBtn";
import CustomizedReadOnlyTextInput from "../../atoms/CustomizedReadOnlyTextInput/CustomizedReadOnlyTextInput";
import { editedsuccessmsg } from '../../organisms/SuccessMsg/SuccessMsg';
import CustomizedComboboxwithdefaultvalue from '../../atoms/CustomizedComboboxwithdefaultvalue/CustomizedComboboxwithdefaultvalue';
import CustomizedComboboxForAll from "../../atoms/CustomizedCombobox/CustomizedComboboxForAll";
import '../../../Styles/style.css';

const EditDealersReportForm = ({ rowdata, handleClose }) => {
    const [updaterowdata, setUpdaterowdata] = useState();
    const [dealerstatus, setdealerstatus] = useState(["active", "inactive"]);
    useEffect(() => {
        setUpdaterowdata(rowdata);
    }, [])
    const submiteventclicked = (e) => {
        console.log("updaterowdata",updaterowdata);
        fetch('http://localhost:3000/updateDealersDetails', {
            method: 'put',
            headers: {
                'Content-Type': 'application/json'
            },
            mode: 'cors',
            body: JSON.stringify(updaterowdata)
        })
            .then(res => {
                return res.json()
            })
            .then(data => {
                const res = editedsuccessmsg({});
                alert(res.msg);
                handleClose();
            })
    }
    const changeevent = (event) => {
        setUpdaterowdata({ ...updaterowdata, [event.target.name]: event.target.value })
    }
    const selectevent = (event) => {
        setUpdaterowdata({ ...updaterowdata, "gstin_status": event.target.innerText })
    }
    return (
        <div>
            <div className="pageheading">
                Edit Dealers Details
            </div>
            <form>
                <div className="nameandinputcontainer">
                    <label className="formdatalabelstyle">
                        <div className="formnamestyle">
                            Enterprise Name:
                        </div>
                        <div className="formdatainputstyle">
                            <input
                                name="enterprise_name"
                                defaultValue={rowdata.enterprise_name}
                                onChange={changeevent}
                                type="text"
                            />
                        </div>
                    </label>
                </div>
                <div className="nameandinputcontainer">
                    <label className="formdatalabelstyle">
                        <div className="formnamestyle">
                            Enterprise Address:
                        </div>
                        <div className="formdatainputstyle">
                            <input
                                name="enterprise_address"
                                defaultValue={rowdata.enterprise_address}
                                onChange={changeevent}
                                type="text"
                            />
                        </div>
                    </label>
                </div>
                <div className="nameandinputcontainer">
                    <label className="formdatalabelstyle">
                        <div className="formnamestyle">
                            Proprietor Name:
                        </div>
                        <div className="formdatainputstyle">
                            <input
                                name="proprietor_name"
                                defaultValue={rowdata.proprietor_name}
                                onChange={changeevent}
                                type="text"
                            />
                        </div>
                    </label>
                </div>
                <div className="nameandinputcontainer">
                    <label className="formdatalabelstyle">
                        <div className="formnamestyle">
                            Proprietor Phone Number:
                        </div>
                        <div className="formdatainputstyle">
                            <input
                                name="proprietor_phone_number"
                                defaultValue={rowdata.proprietor_phone_number}
                                onChange={changeevent}
                                type="number"
                            />
                        </div>
                    </label>
                </div>
                <div className="nameandinputcontainer">
                    <label className="formdatalabelstyle">
                        <div className="formnamestyle">
                            GSTIN Number:
                        </div>
                        <div className="formdatainputstyle">
                            <input
                                // name="gstin_number"
                                defaultValue={rowdata.gstin_number}
                                // onChange={changeevent}
                                type="text"
                                readOnly
                            />
                        </div>
                    </label>
                </div>
                <div className="nameandinputcontainer">
                    <label className="formdatalabelstyle">
                        <div className="formnamestyle">
                            GSTIN Status:
                        </div>
                        <div className="formdatainputstyle">
                            <CustomizedComboboxForAll 
                            comboboxdata={dealerstatus}
                            selectevent={selectevent}
                            selectedvalue={rowdata.gstin_status}
                            />
                        </div>
                    </label>
                </div>
                <div className="submitcontainee">
                    <CustomizedBtn
                        BtnName="submit"
                        onClick={submiteventclicked}
                    />
                </div>
            </form>
        </div>
    )
}
export default EditDealersReportForm;
